// import logo from './logo.svg';
import './App.css';
import logo from './CLC_logo1.png'
import menu from './Menu.png'
import background from './background.png'
import './css/app.css'

function App() {
  return (
    <div className="App">
      <div id='header' style={{backgroundColor: 'black'}}> <img className='logo' src={logo}/> <img className='menu' src={menu}/> </div>
      <div style={{backgroundImage: background}}></div>
    </div>
  );
}

export default App;
